class formato_DISCAP {
  constructor(params) {
    this.hcprc = params.hcprc;
    this.detalles = params.detalles;
    this.paci = params.paci;
    this.opciones = params.opciones || {};
    this.datos = {};
  }

  _init() {
    this.llenarEncabezado();
  }

  llenarEncabezado() {
    this.datos.encabezado = {};
    this.datos.encabezado.titulo = "CERTIFICADO DE DISCAPACIDAD";
    this.datos.encabezado.nombre = $_USUA_GLOBAL[0].NOMBRE;
    this.datos.encabezado.nit = $_USUA_GLOBAL[0].NIT;

    this.enf_actual = this.detalles.find((e) => e["COD-DETHC"] == "1001" && e["LLAVE-HC"] == this.hcprc.llave);
    if (this.enf_actual) this.enf_actual = this.enf_actual.DETALLE.enterPut();

    this.llenarDatosPaciente();
  }

  llenarDatosPaciente() {
    this.datos.paciente = llenarPacienteAperturas2_impHc(this.paci, this.hcprc);

    this.llenarDatos();
  }

  async llenarDatos() {
    let calc = await this.calcularDiscap();
    calc > 1 ? (this.datos.multiple = "S") : (this.datos.multiple = "N");

    this.datosMedico();
  }

  datosMedico() {
    this.datos.medico = {};

    this.datos.medico.nombre = this.hcprc.descrip_med;
    this.datos.medico.espec = this.hcprc.descrip_espec_med;
    this.datos.medico.reg = this.hcprc.reg_med;
    this.datos.medico.firma = parseFloat(this.hcprc.med);

    this.imprimir();
  }

  imprimir() {
    _impresion2({
      tipo: "pdf",
      archivo: `${localStorage.Usuario + moment().format("-YYMMDD-HHmmssS")}.pdf`,
      content: this.format(),
    })
      .then(() => {
        console.log("DISCAP");
      })
      .catch((err) => {
        console.error(err);
        CON851("", "Error impresion FINDRISK", null, "error", "Error");
      });
  }

  format() {
    return {
      images: { logo: rutaLogos_impHc($_USUA_GLOBAL[0].NIT), firma: rutaFirmas_impHc(this.datos.medico.firma) },
      pageMargins: marginEncabezado_impHc(),
      header: encabezadoAperturas_impHc(this.datos),
      content: [
        {
          margin: [0, 5, 0, 0],
          stack: [
            {
              stack: this.llenarFormato(),
            },
          ],
        },
      ],

      styles: estilosImpresion_impHc(),
    };
  }

  llenarFormato() {
    return [
      {
        columns: [
          {
            width: "30%",
            marginTop: 10,
            marginRight: 20,
            table: {
              widths: ["20%", "80%"],
              headerRows: 0,
              body: [[{ text: "Determinar la discapacidad", style: "left8Bold", colSpan: 2 }, {}]],
            },
            layout: "noBorders",
          },
          {
            width: "70%",
            marginTop: 10,
            table: {
              widths: ["30%", "30%"],
              headerRows: 3,
              body: [
                [
                  { text: "Fisica", style: "left8Bold" },
                  {
                    text:
                      this.hcprc.rips.discapacidades.fisica == "S"
                        ? "SI"
                        : this.hcprc.rips.discapacidades.fisica == "N"
                        ? "NO"
                        : "",
                    style: "left8",
                  },
                ],
                [
                  { text: "Mental", style: "left8Bold" },
                  {
                    text:
                      this.hcprc.rips.discapacidades.mental == "S"
                        ? "SI"
                        : this.hcprc.rips.discapacidades.mental == "N"
                        ? "NO"
                        : "",
                    style: "left8",
                  },
                ],
                [
                  { text: "Cognitiva", style: "left8Bold" },
                  {
                    text:
                      this.hcprc.rips.discapacidades.cognitiva == "S"
                        ? "SI"
                        : this.hcprc.rips.discapacidades.cognitiva == "N"
                        ? "NO"
                        : "",
                    style: "left8",
                  },
                ],
                [
                  { text: "Auditiva", style: "left8Bold" },
                  {
                    text:
                      this.hcprc.rips.discapacidades.auditiva == "S"
                        ? "SI"
                        : this.hcprc.rips.discapacidades.auditiva == "N"
                        ? "NO"
                        : "",
                    style: "left8",
                  },
                ],
                [
                  { text: "Visual", style: "left8Bold" },
                  {
                    text:
                      this.hcprc.rips.discapacidades.visual == "S"
                        ? "SI"
                        : this.hcprc.rips.discapacidades.visual == "N"
                        ? "NO"
                        : "",
                    style: "left8",
                  },
                ],
                [
                  { text: "Discapacidad multiple", style: "left8Bold" },
                  {
                    text: this.datos.multiple == "S" ? "SI" : this.datos.multiple == "N" ? "NO" : "",
                    style: "left8",
                  },
                ],
              ],
            },
            layout: "noBorders",
          },
        ],
      },
      this.enf_actual
        ? {
          marginTop: 5,
            style: "left8",
            stack: [{ text: "Resumen de Historia Clinica", bold: true }, { text: this.enf_actual, alignment: "justify" }],
          }
        : {},
      {
        marginTop: 10,
        stack: [
          { text: "Diagnósticos", style: "left8Bold" },
          {
            marginLeft: 20,
            style: "left8",
            stack: this.llenarDiagnosticos(),
          },
        ],
      },
      firmaImpresion_impHc(this.datos),
      {
        text: "Se expide el presente certificado de acuerdo a la circular 00003 del 4 de febrero del 2019, expedida por la unidad para la atencion y reparacion integral a las victimas.",
        style: "center8",
        marginTop: 15,
        pageBreak: "after",
      },
      {
        image:
          "data:image/png;base64,",
        width: 525,
        height: 550,
        marginTop: 20,
      },
    ];
  }

  calcularDiscap() {
    let aux = 0;

    this.hcprc.rips.discapacidades.fisica == "S" ? (aux = aux + 1) : false;
    this.hcprc.rips.discapacidades.mental == "S" ? (aux = aux + 1) : false;
    this.hcprc.rips.discapacidades.cognitiva == "S" ? (aux = aux + 1) : false;
    this.hcprc.rips.discapacidades.auditiva == "S" ? (aux = aux + 1) : false;
    this.hcprc.rips.discapacidades.visual == "S" ? (aux = aux + 1) : false;

    return aux;
  }

  llenarDiagnosticos() {
    let arreglo = [];
    for (var i in this.hcprc.rips.tabla_diagn) {
      if (this.hcprc.rips.tabla_diagn[i].cod_diagn.trim()) {
        arreglo.push({
          columns: [
            { text: this.hcprc.rips.tabla_diagn[i].cod_diagn, width: "5%" },
          ],
        });
      }
    }

    return arreglo;
  }
}

const imprimir_DISCAP = (params) => {
  var formato = new formato_DISCAP(params);
  formato._init();
};

module.exports = {
  imprimir_DISCAP,
};
